import React from 'react'
import '../style/Leyout.css'
import Logo from '../imag/logos.PNG';

export default function Layout(props) {
    return (
        <React.Fragment>
          <header>
           <img className="logo" src={Logo}/>
           <div>
            {props.children}
           </div>
          </header>

          <footer>
             <p>Desarrollado por mi</p>
          </footer>
        </React.Fragment>

    )
}
